import React from "react";
import RoadmapImg from '../../assets/bg-footer.jpg'
import './style.css'

function Roadmap() {
  return (
    <>
    <div className="mpl-box-md">
      <div className="container">
        <h2 className="display-2 mb-60 text-center">
          Roadmap
        </h2>
      </div>
    </div>
    </>
  );
}

export default Roadmap;
